        "import os\n",
        "import torch\n",
        "import torch.nn as nn\n",
        "import torch.optim as optim\n",
        "from torch.utils.data import DataLoader, Dataset\n",
        "from torchvision import models, transforms\n",
        "import torch.nn.functional as F\n",
        "from PIL import Image\n",
        "import numpy as np\n",
        "from tqdm import tqdm\n",
        "\n",
        "class SegmentationDataset(Dataset):\n",
        "    def __init__(self, image_folder, mask_folder, transform=None, mask_transform=None):\n",
        "        self.image_folder = image_folder\n",
        "        self.mask_folder = mask_folder\n",
        "        self.transform = transform\n",
        "        self.mask_transform = mask_transform\n",
        "        self.image_files = sorted(os.listdir(image_folder))\n",
        "        self.mask_files = sorted(os.listdir(mask_folder))\n",
        "        self.class_mapping = {\n",
        "            \"person\": 0,\n",
        "            \"rider\": 1,\n",
        "            \"car\": 2,\n",
        "            \"truck\": 3,\n",
        "            \"bus\": 4,\n",
        "            \"train\": 5,\n",
        "            \"motorcycle\": 6,\n",
        "            \"bicycle\": 7\n",
        "        }\n",
        "        \n",
        "    def __len__(self):\n",
        "        return len(self.image_files)\n",
        "\n",
        "    def __getitem__(self, idx):\n",
        "        img_path = os.path.join(self.image_folder, self.image_files[idx])\n",
        "        mask_path = os.path.join(self.mask_folder, self.mask_files[idx])\n",
        "        \n",
        "        image = Image.open(img_path).convert(\"RGB\")\n",
        "        mask = Image.open(mask_path).convert(\"L\")\n",
        "        \n",
        "        if self.transform:\n",
        "            image = self.transform(image)\n",
        "        if self.mask_transform:\n",
        "            mask = self.mask_transform(mask)\n",
        "        \n",
        "        mask = torch.tensor(np.array(mask), dtype=torch.long)\n",
        "        \n",
        "        return image, mask\n",
        "\n",
        "# Define transformations\n",
        "image_transform = transforms.Compose([\n",
        "    transforms.Resize((256, 256), interpolation=transforms.InterpolationMode.NEAREST),\n",
        "    transforms.ToTensor(),\n",
        "    transforms.Normalize(mean=[0.485, 0.456, 0.406], std=[0.229, 0.224, 0.225])\n",
        "])\n",
        "\n",
        "mask_transform = transforms.Compose([\n",
        "    transforms.PILToTensor(),\n",
        "    transforms.Resize((256, 256), interpolation=transforms.InterpolationMode.NEAREST),\n",
        "])\n",
        "\n",
        "# Define paths\n",
        "train_image_folder = '/home/huasi/AllNeedCopy_datasets/v5_test/yolov5-master/yolov5-master/custom_dataset/minicity/dataset/images/train'\n",
        "train_mask_folder = '/home/huasi/AllNeedCopy_datasets/v5_test/yolov5-master/yolov5-master/custom_dataset/minicity/dataset/labels/train'\n",
        "val_image_folder = '/home/huasi/AllNeedCopy_datasets/v5_test/yolov5-master/yolov5-master/custom_dataset/minicity/dataset/images/val'\n",
        "val_mask_folder = '/home/huasi/AllNeedCopy_datasets/v5_test/yolov5-master/yolov5-master/custom_dataset/minicity/dataset/labels/val'\n",
        "\n",
        "# Create datasets and dataloaders\n",
